import React from "react";

// core components
import IndexNavbar from '../components/navbars/IndexNavbar.js';
import PageHeader from '../components/PageHeader/PageHeader';
import Footer from "../components/footer/Footer.js";

// sections for demo sheet
import Basics from "./Pieces/Basics.js";
import Navbars from "./Pieces/Navbars.js";
import Tabs from "./Pieces/Tabs.js";
import Pagination from "./Pieces/Pagination.js";
import Typography from "./Pieces/Typography.js";
import JavaScript from "./Pieces/JavaScript.js";
import NucleoIcons from "./Pieces/NucleoIcons.js";
import Signup from "./Pieces/Signup.js";


export default function Index() {
    React.useEffect(() => {
        document.body.classList.toggle("index-page");
      // Specify how to clean up after this effect:
        return function cleanup() {
            document.body.classList.toggle("index-page");
        };
    }, []);
    return (
        <>
            <IndexNavbar />
            <div className="wrapper">
                <PageHeader />
                <div className="main">
                    <Basics />
                    <Navbars />
                    <Tabs />
                    <Pagination />
                    <Typography />
                    <JavaScript />
                    <NucleoIcons />
                    <Signup />
                </div>
                <Footer />
            </div>
        </>
    );
}
